(1, '', 'Planta Artificial Monstera 1', 'planta-artificial-monstera-1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Todos los adornos decorativos exclusivos de tendencia están en&nbsp;<span style=\"font-weight: 700;\">Casa Elida</span>.<o:p></o:p></p><p></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"line-height: 17.12px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Puedes tener tus flores favoritas en cualquier ocasión y en cualquier espacio de tu hogar. Agrégale un detalle verde a tu casa dándole un diseño natural.</span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"line-height: 17.12px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\">Nuestras plantas artificiales de Monstera tienen hojas de forma realista. Estos vienen listos en maceta y es una planta artificial ideal para interiores. Estos se ven particularmente bien en baños, oficinas y salas. Es muy realista el follaje. Los tallos están cableados y se pueden dar forma a tus necesidades.&nbsp;</p>', '<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt -4.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Esta planta artificial\r\nes una réplica realista.<o:p></o:p></p><p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt -4.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Los tallos están alambrados\r\ny pueden ajustarse a diferentes posiciones.<font color=\"#111111\" face=\"Arial, sans-serif\"><span style=\"font-size: 10pt;\"><o:p></o:p></span></font></p>', '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border: none;\">\r\n <tbody><tr>\r\n  <td width=\"236\" valign=\"top\" style=\"width:176.95pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\n  normal\">Categoría<o:p></o:p></p>\r\n  </td>\r\n  <td width=\"208\" valign=\"top\" style=\"width:155.95pt;border:solid windowtext 1.0pt;\r\n  border-left:none;mso-border-left-alt:solid windowtext .5pt;mso-border-alt:\r\n  solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\n  normal\">Decojardín<o:p></o:p></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"236\" valign=\"top\" style=\"width:176.95pt;border:solid windowtext 1.0pt;\r\n  border-top:none;mso-border-top-alt:solid windowtext .5pt;mso-border-alt:solid windowtext .5pt;\r\n  padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\n  normal\">Número de modelo<o:p></o:p></p>\r\n  </td>\r\n  <td width=\"208\" valign=\"top\" style=\"width:155.95pt;border-top:none;border-left:\r\n  none;border-bottom:solid windowtext 1.0pt;border-right:solid windowtext 1.0pt;\r\n  mso-border-top-alt:solid windowtext .5pt;mso-border-left-alt:solid windowtext .5pt;\r\n  mso-border-alt:solid windowtext .