(11, '', 'Planta Artificial Dorada', 'planta-artificial-dorada', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Todos los adornos decorativos exclusivos de tendencia están en&nbsp;<span style=\"font-weight: 700;\">Casa Elida</span>.<o:p></o:p></p><p></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"line-height: 17.12px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Puedes tener tus flores favoritas en cualquier ocasión y en cualquier espacio de tu hogar. Agrégale un detalle verde a tu casa dándole un diseño natural.</span></p><p class=\"MsoNormal\" style=\"text-align: justify;\"><span style=\"line-height: 17.12px; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"></span></p><p class=\"MsoNormal\" style=\"text-align: justify;\">Nuestras plantas artificiales&nbsp; tienen hojas de forma realista. Estos vienen listos en maceta, es una planta artificial ideal para interiores. Estos se ven particularmente bien en baños, cocinas, salas. Es muy realista el follaje. Los tallos están cableados y se pueden dar forma a tus necesidades.&nbsp;</p>', '<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0.0001pt -4.5pt; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Esta planta artificial es una réplica realista.<o:p></o:p><