(41, '', 'Set de Frascos de Vidrio Hawai', 'set-de-frascos-de-vidrio-hawai', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p style=\"text-align: justify; \">Precioso set de frascos de vidrio Hawai, ofrecen una manera atractiva y fácil de almacenar, ordenar y organizar cualquier habitación de su hogar u oficina. Almacenamiento transparente y de fácil acceso para alimentos secos en la cocina, dulces, bocadillos y golosinas, artículos de baño y tocadores&nbsp; o artículos para el hogar más pequeños. Trae alegría a tu estilo de vida y experiencias cotidianas al tener todo organizado, accesible y almacenado.<br></p>', '<p class=\"MsoNormal\">Hermoso acabado.<o:p></o:p></p><p class=\"MsoNormal\">Diseño vintage.</p><p class=\"MsoNormal\"><o:p></o:p></p><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\">Dimensiones: 22 x 35 cm.</p><p class=\"MsoNormal\">Material: vidrio y metal.</p><p class=\"MsoNormal\">Elegante Tapa de vidrio.</p><p class=\"MsoNormal\"><o:p></o:p></p>', '<p>\r\n </p><p></p><p></p>Medidas: 22x35cm<p></p><table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border: none;\"><tbody><tr>\r\n  <td width=\"236\" valign=\"top\" style=\"width:176.95pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\n  normal\">Categoría <o:p></o:p></p>\r\n  </td>\r\n  <td width=\"208\" valign=\"top\" style=\"width:155.95pt;border:solid windowtext 1.0pt;\r\n  border-left:none;mso-border-left-alt:solid windowtext .5pt;mso-border-alt:\r\n  solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:.0001pt;line-height:\r\n  normal\">Cocina y Comedor<o:p></o:p></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"236\" valign=\"top\" style=\"width:176.95pt;border:solid windowtext 1.0pt;\r\n  border-top:none;mso-border-top-alt:solid windowtext .5