(42, '', 'Portaincienso  Pluma', 'portaincienso-pluma', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p class=\"MsoNormal\" style=\"text-align: justify; margin: 0cm 0cm 0.0001pt -4.5pt; line-height: normal;\">Los adornos son complementos decorativos muy interesantes, cuando queremos realzar o avivar algún aspecto concreto de nuestra decoración.<o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align: justify; margin: 0cm 0cm 0.0001pt -4.5pt; line-height: normal;\">Si eres amante del buen gusto, seguro que querrás integrar en tu decoración esta propuesta y disfrutar al máximo de las opciones decorativas que ofrece&nbsp;Casa Elida.<o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align: justify; margin: 0cm 0cm 0.0001pt -4.5pt; line-height: normal;\">Este portaincienso&nbsp; está fabricado en poliresina de color dorado, está inspirada en una pluma.<o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align: justify; margin: 0cm 0cm 0.0001pt -4.5pt; line-height: normal;\">Una elegante figura que&nbsp;simboliza la confianza, el honor, la fuerza, la sabiduría, el poder, la libertad&nbsp;,&nbsp;<span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">completa el aspecto de lo que seguramente será una atractiva adición mística a cualquier espacio de tu casa.</span></p>', '<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent: -18pt;\"><span style=\"font-family: Symbol;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></span>Pintado a mano por expertos.<o:p></o:p></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent: -18pt;\"><span style=\"font-family: Symbol;\">·<span style=\"font-variant-numeric: normal; font-variant-e