(199, '', 'Mini licuadora portátil verde - 60505', 'mini-licuadora-portatil-verde-60505', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p class=\"MsoNormal\" style=\"text-align:justify\">Esta hermosa Mini licuadora portátil puede\r\nservir como batidor, mezclador de alimentos, la forma delgada y\r\ndiseño elegante le dan una gran utilidad en el hogar y a cualquier lugar a\r\ndonde puedas llevarla.</p><p class=\"MsoNormal\" style=\"text-align:justify\">\r\nFácil de manejar, bajo ruido y larga vida útil. Diseño compacto, fácil de\r\nalmacenar, limpieza rápida y sencilla.</p>', '<p>- Diseño compacto.<br></p><p>-&nbsp;Licuadora para bebidas de frutas y mucho más.<br style=\"box-sizing: inherit;\">-&nbsp;También&nbsp;pica&nbsp;el hielo.<br style=\"box-sizing: inherit;\">-&nbsp;Sistema de seguridad, no funciona al desmontarlo.<br style=\"box-sizing: inherit;\">-&nbsp;Rápido: se puede preparar un zumo en 1 minuto.<br style=\"box-sizing: inherit;\">-&nbsp;Contiene: 380 ml<br style=\"box-sizing: inherit;\">-&nbsp;Sistema automático de cierre de vacío: 5s<br style=\"box-sizing: inherit;\">-&nbsp;Usar con una recarga completa: alrededor de 10-12 veces<br style=\"box-sizing: inherit;\"></p><p style=\"padding: 0px; margin-top: 0em; margin-bottom: 1em; margin-left: 1em;\"><span style=\"font-size: 11px;\">Consejos:</span><br><span style=\"font-size: 11px;\">El exprimidor se tiene que cargar 3 horas antes de usarse.</span><br><span style=\"font-size: 11px;\">No utilices el exprimidor cuando se esté cargando.</span><br><span style=\"font-size: 11px;\">Antes de usar, pon un poco de agua en la taza y enciende para lavar la taza.</span><br><span style=\"font-size: 11px;\">Corta la fruta en trozos de 1,5 x 1,5 cm, ponlas en la taza y luego vierte en algo de leche o agua. Pon la máquina hacia abajo y enciéndela. Cuando el núcleo de la espátula comience a funcionar, gira la máquina y empieza a hacer zumo.</span><br><span style=\"font-size: 11px;\">Cuando los trozos de fruta son demasiado grandes, reinicia la máquina.&nbsp;</span></p><p style=\"padding: 0px; margin-top: 0em; margin-bottom: 1em; margin-left: 1em;\"><span style=\"font-size: 11px;\">Mantenimiento:</span><br><span style=\"font-size: 11px;\">No utilices lejía alcalina, metal, toallitas químicas, gasolina, alambre de metal y otros productos de limpieza.</span><br></p>', '<table class=\"MsoNormalTable\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: -0.5pt;\">\r\n <tbody><tr>\r\n  <td width=\"236\" style=\"width:176.95pt;border:solid windowtext 1.0pt;padding:\r\n  0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\">Categoría<o:p></o:p><u1:p></u1:p></p>\r\n  </td>\r\n  <td width=\"293\" style=\"width: 219.95pt; border-top: 1pt solid windowtext; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: none; padding: 0cm 5.4pt; border-image: initial;\">\r\n  Electrohogar</td>\r\n </tr>\r\n <tr>\r\n  <td width=\"236\" style=\"width:176.95pt;border:solid windowtext 1.0pt;border-top:\r\n  none;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\">Tipo<o:p></o:p><u1:p></u1:p></p>\r\n  </td>\r\n  <td width=\"293\" style=\"width: 219.95pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext; padding: 0cm 5.4pt;\">\r\n  <p class=\"MsoNormal\">Minilicuadora<o:p></o:p><u1:p></u1:p></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"236\" style=\"width:176.95pt;border:solid windowtext 1.0pt;border-top:\r\n  none;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\">Número de modelo<o:p></o:p><u1:p></u1:p></p>\r\n  </td>\r\n  <td width=\"293\" style=\"width: 219.95pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext; padding: 0cm 5.4pt;\">\r\n  <p class=\"MsoNormal\">&nbsp;60505<o:p></o:p><u1:p></u1:p></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"236\" style=\"width:176.95pt;border:solid windowtext 1.0pt;border-to