(200, '', 'Mini Licuadora portátil celeste - 60505', 'mini-licuadora-portatil-celeste-60505', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 7.5pt; line-height: normal;\">Esta Práctica y hermosa Minilicuadora portátil puede servir como batidor, mezclador de\r\nalimentos, la forma delgada y diseño elegante le dan una gran utilidad en el\r\nhogar y a cualquier lugar a donde puedas llevarla.<o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align: justify; margin-bottom: 7.5pt; line-height: normal;\">Fácil de manejar, bajo ruido y larga vida útil. Diseño compacto, fácil\r\nde almacenar, limpieza rápida y sencilla.</p>', '<p style=\"margin: 0cm 0cm 7.5pt;\">- Licuadora para bebidas de frutas y mucho más.<br style=\"box-sizing: inherit;\">-&nbsp;También&nbsp;pica&nbsp;el hielo.<br style=\"box-sizing: inherit;\">-&nbsp;Sistema de seguridad, no funciona al desmontarlo.<br style=\"box-sizing: inherit;\">-&nbsp;Rápido: se puede preparar un zumo en 1 minuto.<br style=\"box-sizing: inherit;\">-&nbsp;Contiene: 380 ml<br style=\"box-sizing: inherit;\">-&nbsp;Sistema automático de cierre de vacío: 5s<br style=\"box-sizing: inherit;\">-&nbsp;Usar con una recarga completa: alrededor de 10-12 veces<o:p></o:p></p><p style=\"margin: 0cm 0cm 12pt 12pt;\"><span style=\"font-size: 8.5pt;\">Consejos:</span><br><span style=\"font-size: 8.5pt;\">El exprimidor se tiene que cargar 3 horas antes de usarse.</span><br><span style=\"font-size: 8.5pt;\">No utilices el exprimidor cuando se esté cargando.</span><br><span style=\"font-size: 8.5pt;\">Antes de usar, pon un poco de agua en la taza y enciende para lavar la taza.</span><br><span style=\"font-size: 8.5pt;\">Corta la fruta en trozos de 1,5 x 1,5 cm, ponlas en la taza y luego vierte en algo de leche o agua. Pon la máquina hacia abajo y enciéndela. Cuando el núcleo de la espátula comience a funcionar, gira la máquina y empieza a hacer zumo.</span><br><span style=\"font-size: 8.5pt;\">Cuando los trozos de fruta son demasiado grandes, reinicia la máquina.&nbsp;</span><o:p></o:p></p><p style=\"margin: 0cm 0cm 12pt 12pt;\"><span style=\"font-size: 8.5pt;\">Mantenimiento:</span><br><span style=\"font-size: 8.5pt;\">No utilices lejía alcalina, metal, toallitas químicas, gasolina, alambre de metal y otros productos de limpieza.</span></p>', '<table class=\"MsoNormalTable\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: -0.5pt;\">\r\n <tbody><tr>\r\n  <td width=\"236\" style=\"width:176.95pt;border:solid windowtext 1.0pt;padding:\r\n  0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"line-height:normal\">Categoría<o:p></o:p><u1:p></u1:p></p>\r\n  </td>\r\n  <td width=\"293\" style=\"width: 219.95pt; border-top: 1pt solid windowtext; border-right: 1pt solid windowtext; border-bottom: 1pt solid windowtext; border-left: none; padding: 0cm 5.4pt; border-image: initial;\">\r\n  Electrohogar<br>\r\n  </td>\r\n </tr>\r\n <tr style=\"mso-yfti-irow:1;height:17.15pt\">\r\n  <td width=\"236\" style=\"width:176.95pt;border:solid windowtext 1.0pt;border-top:\r\n  none;padding:0cm 5.4pt 0cm 5.4pt;height:17.15pt\">\r\n  <p class=\"MsoNormal\" style=\"line-height:normal\">Tipo<o:p></o:p><u1:p></u1:p></p>\r\n  </td>\r\n  <td width=\"293\" style=\"width: 219.95pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt solid windowtext; padding: 0cm 5.4pt; height: 17.15pt;\">\r\n  <p class=\"MsoNormal\" style=\"line-height: normal;\">Mini Licuadora<o:p></o:p><u1:p></u1:p></p>\r\n  </td>\r\n </tr>\r\n <tr>\r\n  <td width=\"236\" style=\"width:176.95pt;border:solid windowtext 1.0pt;border-top:\r\n  none;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"line-height:normal\">Número\r\n  de modelo<o:p></o:p><u1:p></u1:p></p>\r\n  </td>\r\n  <td width=\"293\" style=\"width: 219.95pt; border-top: none; border-left: none; border-bottom: 1pt solid windowtext; border-right: 1pt sol