(207, '', 'Lonchera eléctrica rojo - 60511', 'lonchera-electrica-rojo-60511', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p class=\"MsoNormal\" style=\"text-align: justify; \">Adiós&nbsp;a las comidas frías&nbsp;con ﻿esta\r\nlonchera&nbsp;eléctrica,&nbsp;es una excelente opción para trabajadores y\r\nestudiantes que comen fuera de su casa, oficina o universidad donde no se\r\ndispone de microondas. Cuenta con dos amplios espacios que te permiten\r\nalmacenar los alimentos, un contenedor extraíble de acero inoxidable de\r\n1,5 litros y otro compartimento&nbsp; adicional de 0.45 litros. No más\r\npreocupaciones por que las comidas que se mezclen, tiene compartimiento para cubiertos (incluye una cuchara).<o:p></o:p></p>', '<p class=\"MsoNormal\">Fácil limpieza<o:p></o:p></p><p class=\"MsoNormal\">Material: cubierta de plástico y envase de acero inoxidable.<o:p></o:p></p><p class=\"MsoNormal\">Portacucharas y cuchara.<o:p></o:p></p><p class=\"MsoNormal\">Dos amplios compartimientos.<o:p></o:p></p><p class=\"MsoNormal\">Válvula para evacuar el vapor.<o:p></o:p></p><p class=\"MsoNormal\">Este calentador portátil eléctrica está hecha de plástico PP inocuo para alimentos y de acero inoxidable 304. Material no frágil, resistente a temperaturas altas,sin tóxico y saludable.&nbsp;</p><p class=\"MsoNormal\"><o:p></o:p></p><div><h5 class=\"a-color-secondary\" style=\"padding: 0px; margin: 0px; line-height: 19px;\"><span style=\"font-size: 10px;\">Consejos:</span></h5><p class=\"a-spacing-small a-size-small a-color-secondary\" style=\"padding: 0px; line-height: 1.5 !important;\"></p><ul class=\"a-unordered-list a-vertical\" style=\"margin-right: 0px !important; margin-bottom: 18px !important; margin-left: 18px !important; padding: 0px !important;\"><li style=\"list-style: disc; overflow-wrap: break-word; margin: 0px !important;\"><span class=\"a-list-item\" style=\"font-size: 11px;\">El tiempo de calentamiento varía según la cantidad comida.</span></li><li style=\"lis