(209, '', 'Lonchera eléctrica verde - 60511', 'lonchera-electrica-verde-60511', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p style=\"box-sizing: inherit; margin-bottom: 0px; text-align: justify; padding: 0px; font-family: Arial, Roboto, -apple-system, Helvetica, sans-serif; font-size: 0.9rem; line-height: 1.5rem; color: rgb(102, 102, 102);\"><span style=\"font-size: 14px;\">﻿</span><span style=\"color: rgb(0, 0, 0); font-family: Ubuntu, serif; font-size: 16px;\">Adiós&nbsp;a las comidas frías&nbsp;con ﻿esta lonchera&nbsp;eléctrica,&nbsp;es una excelente opción para trabajadores y estudiantes que comen fuera de su casa, oficina o universidad donde no se dispone de microondas. Cuenta con dos amplios espacios que te permiten almacenar los alimentos, un contenedor extraíble de acero inoxidable de 1,5 litros y otro compartimento&nbsp; adicional de 0.45 litros. No más preocupaciones por que las comidas que se mezclen, tiene compartimiento para cubiertos (incluye una cuchara).</span></p>', '<p class=\"MsoNormal\" style=\"text-align: justify;\">Fácil limpieza<o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align: justify;\">Material: cubierta de plástico y envase de acero inoxidable.<o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align: justify;\">Portacucharas y cuchara.<o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align: justify;\">Dos amplios compartimientos.<o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align: justify;\">Válvula para evacuar el vapor.<o:p></o:p></p><p class=\"MsoNormal\" style=\"text-align: justify;\">Este calentador portátil eléctrica está hecha de plástico PP inocuo para alimentos y de acero inoxidable 304. Material no frágil, resistente a temperaturas altas,sin tóxico y saludable.&nbsp;</p><p class=\"MsoNormal\"><o:p></o:p></p><div><h5 class=\"a-color-secondary\" style=\"line-height: 19px; margin: 0px; text-align: justify; padding: 0px;\"><span style=\"font-size: 10px;\">Consejos:</span></h5><p class=\"a-spacing-small a-size-small a-color-secondary\" style=\"padding: 0px; line-height: 1.5 !important;\"></p><ul class=\"a-unordered-list a-vertical\" style=\"margin-bottom: 18px !important; margin-right: 0px !important; margin-left: 18px !important; padding: 0px !important;\"><li style=\"text-align: justify; list-style: disc; overflow-wrap: break-word; margin: 0px !important;\"><span class=\"a-list-item\" style=\"font-size: 11px;\">El tiempo de calentamiento varía según la cantidad comida.</span></li><li style=\"text-align: justify; list-style: disc; overflow-wrap: break-word; margin: 0px !important;\"><span class=\"a-list-item\" style=\"font-size: 11px;\">Si la comida está a temperatura ambiente, puede tardar unos 40 minutos en conseguir la temperatura adecuada. Tarda más en invierno.</span></li><li style=\"text-align: justify; list-style: disc; overflow-wrap: break-word; margin: 0px !important;\"><span style=\"font-size: 11px;\">No calentar en el microondas.</span><br></li><li style=\"text-align: justify; list-style: disc; overflow-wrap: break-word; margin: 0px !important;\"><span class=\"a-list-item\" style=\"font-size: 11px;\">No dejar en el refrigerador.</span></li><li style=\"text-align: justify; list-style: disc; overflow-wrap: break-word; margin: 0px !important;\"><span class=\"a-list-item\" style=\"font-size: 11px;\">No sumerja la fiambrera en agua para limpiarla.</span></li></ul></div>', '<div class=\"title\" style=\"box-sizing: inherit; margin: 0px; padding: 0px;\"><table class=\"MsoNormalTable\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: -0.5pt;\">\r\n <tbody><tr>\r\n  <td width=\"170\" style=\"width:127.6pt;border:solid windowtext 1.0pt;padding:\r\n  0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\">Categoría</p>\r\n  </td>\r\n  <td width=\"387\" style=\"width:290.6pt;border:solid windowtext 1.0pt;border-left:\r\n  none;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\">Electrohogar<br></p>\r\n  </td>\r\n </tr>\r\n <tr style=\"mso-yfti-irow