(234, '', 'Tomatodo con Filtro 1 L  Dan', 'tomatodo-con-filtro-1-l-dan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p><span style=\"text-align: justify;\">Mantenerse bien hidratado es esencial para la salud y bienestar general. Especialmente cuando usted está en movimiento o participando en actividades físicas de cualquier tipo.</span></p><p><span style=\"text-align: justify;\">Es por eso que tenemos el mejor aliado de hidratación para que puedas llevarlo cómodamente contigo y saciar tu sed en cualquier lugar y en cualquier momento.</span></p><p><div style=\"text-align: justify;\">Puedes mantenerte hidratado eficazmente, ya sea para la casa, trabajo, en el gimnasio, para deportes, en tu coche, en la playa, camping, senderismo, viajes y casi cualquier otra actividad .</div><div style=\"text-align: justify;\">A partir de hoy: mantente hidratado y sentirte fresco todo el día – ¡Todos los días!</div></p>', '<ul><li style=\"text-align: justify;\">Medidas: 16.5 x 8.5 cm</li><li style=\"text-align: justify;\">Material: Vidrio con forro de tela</li><li style=\"text-align: justify;\">Capacidad: 1Litro</li><li style=\"text-align: justify;\">A prueba de fugas y polvo.</li><li style=\"text-align: justify;\">Cómoda para su transporte.</li><li style=\"text-align: justify;\">Fácil de limpiar</li></ul><p style=\"text-align: justify; \"><br></p><p></p><div style=\"text-align: justify;\">Nota:</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">1. No congelar cuando esté lleno.</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">2. No está destinado a menos de -5°C y más de 95°C líquido.</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">3. No utilizar en microondas ni lavavajillas. Se recomienda lavar a mano.</div><div style=\"text-align: justify;\"><br></div>', '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border: none;\">\